/* eslint-disable react/react-in-jsx-scope */
/* eslint-disable array-callback-return */
/* eslint-disable react/prop-types */
/* eslint-disable react/jsx-boolean-value */
/* eslint-disable no-useless-escape */
/* eslint-disable arrow-body-style */
/* eslint-disable no-param-reassign */
/* eslint-disable yoda */
/* eslint-disable prefer-const */
/* eslint-disable no-undef */
/* eslint-disable no-unused-vars */
import { useCallback, useEffect, useState } from "react";
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import PropTypes from "prop-types";
import Divider from "@mui/material/Divider";
import { Grid, Typography, Box } from "@mui/material";
import ReactDataGrid from "@inovua/reactdatagrid-enterprise";
import "@inovua/reactdatagrid-enterprise/index.css";
import { useDispatch, useSelector } from "react-redux";
import { usersActions } from "../../store/userSlice";

const gridStyle = { minHeight: 250 };

const columns = [
  {
    name: "la",
    header: "Language",
    defaultFlex: 1,
    type: "string",
  },
  { name: "id", header: "Id", type: "number", defaultVisible: false },
];

// eslint-disable-next-line arrow-body-style
const DialogLanLogin = ({ open, close }) => {
  const [selected, setSelected] = useState({});
  const [locationArray, SetLocationArray] = useState([]);
  const [selectedSite, SetSelectedSite] = useState([]);
  const storedSite = localStorage.getItem("siteCode");
  const dispatch = useDispatch();

  const loadLocation = async () => {
    try {
      const data = await fetch(`/echoMe/loc/listLocSite`);
      if (!data.ok) {
        console.log("error message from loadLocation");
        let errorText = await data.text();
        console.log(errorText);
        throw Error(errorText);
      }
      const json = await data.json();
      const temp = [];
      json.map((r) => {
        return temp.push({ id: r.id, siteCode: r.siteCode });
      });
      SetLocationArray(temp);
    } catch (err) {
      console.error(err);
    }
  };

  const handleClose = () => {
    close();
  };

  const selectHandler = async () => {
    let tempLocation = locationArray
      .filter((r) => {
        return r.id === selected;
      })
      .map((r) => r.siteCode);
    SetSelectedSite(tempLocation);
    dispatch(usersActions.updateSiteCode(tempLocation));
    try {
      const data = await fetch(`/echoMe/site?siteCode=${tempLocation}`);
      if (!data.ok) {
        console.log("error message from loadLocation");
        let errorText = await data.text();
        console.log(errorText);
        throw Error(errorText);
      }
      alert(`Site is succesfully seleced to ${tempLocation}`);
      localStorage.setItem("siteCode", tempLocation);
      handleClose();
    } catch (err) {
      console.error(err);
      alert(err);
    }
  };

  const locationReloader = async () => {
    try {
      const data = await fetch(`/echoMe/site?siteCode=${storedSite}`);
      if (!data.ok) {
        console.log("error message from locationReloader");
        let errorText = await data.text();
        console.log(errorText);
        throw Error(errorText);
      }
    } catch (err) {
      console.error(err);
      alert(err);
    }
  };

  // eslint-disable-next-line no-shadow
  const onSelectionChange = useCallback(({ selected }) => {
    setSelected(selected);
  }, []);

  useEffect(() => {
    loadLocation();
  }, []);

  useEffect(() => {
    locationReloader();
  }, [storedSite]);

  console.log(storedSite);

  return (
    <>
      <Dialog
        open={open}
        onClose={close}
        fullWidth={true}
        maxWidth="sm"
        disableEscapeKeyDown={true}
        onBackdropClick="false"
      >
        <DialogTitle>Site Selection</DialogTitle>
        <DialogContent>
          <DialogContentText align="left">
            Please Select the Site.
            <Box variant="div" sx={{ padding: "20px" }}>
              <form>
                <Grid container spacing={2}>
                  <Grid item xs={12} sm={12}>
                    <ReactDataGrid
                      idProperty="id"
                      checkboxColumn
                      selected={selected}
                      multiSelect={false}
                      onSelectionChange={onSelectionChange}
                      style={gridStyle}
                      columns={columns}
                      dataSource={locationArray}
                    />
                  </Grid>
                </Grid>
              </form>
            </Box>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={selectHandler}>Select</Button>
        </DialogActions>
      </Dialog>
    </>
  );
};

export default DialogLanLogin;
